import React, { useState } from "react";
import ReactDOM from "react-dom";
import "antd/dist/antd.css";
import "./index.css";
import {
  Form,
  Input,
  Select,
  InputNumber,
  Checkbox,
  Button,
  Layout,
  Space
} from "antd";
const { Content, Footer } = Layout;
const Webform = () => {
  const [componentSize, setComponentSize] = useState("default");

  const onFormLayoutChange = ({ size }) => {
    setComponentSize(size);
  };

  return (
   <Layout style ={{backgroundColor:"black"}}>
    <Content 
      className="site-layout"
      style={{backgroundColor:"white",padding: "30px", margin: 64,textAlign:"center" }}
    >
      
      <Space align="center">
      <Form style={{ContentAlign:"left"}}
        labelCol={{
          span: 14
        }}
        wrapperCol={{
          span: 14
        }}
      
      //layout="horizontal"
         initialValues={{
           size: componentSize
         }}
        onValuesChange={onFormLayoutChange}
         size={componentSize}
      >
        <Form.Item label="Name of the Object ">
          <Input />
        </Form.Item>
        <Form.Item label="Shape">
          <Select>
            
            <Select.Option value="sphere">Sphere</Select.Option>
            <Select.Option value="cube">Cube</Select.Option>
            <Select.Option value="cuboid">Cuboid</Select.Option>
            <Select.Option value="cone">Cone</Select.Option>
            
          </Select>
        </Form.Item>
        <Form.Item label="Dimensions:X">
          <Input />   
        </Form.Item>
        <Form.Item label="Dimensions:Y">
          <Input />   
        </Form.Item><Form.Item label="Dimensions:Z">
          <Input />   
        </Form.Item>
        <Form.Item label="Colour">
          <Select>
            <Select.Option value ="red">Red</Select.Option>
            <Select.Option value ="green">Green</Select.Option>
            <Select.Option value ="yellow">Yellow</Select.Option>
            <Select.Option value ="blue">Blue</Select.Option>
           <Select.Option value = "orange">Orange</Select.Option>
          </Select>
        </Form.Item>
        <Form.Item label="Position">
          <Input />
        </Form.Item>
        <Form.Item label="Render Object">
          <Checkbox></Checkbox>
        </Form.Item>
        <Form.Item style={{marginLeft:212}}>
          <Button type = "primary">Render</Button>
        </Form.Item>
      </Form>
      </Space>
    </Content>
  </Layout>
           
  );
};
export default Webform;

